import React from "react";
import Button from "./Button/Button";
import HorizontalTabs from "./HorizontalTabs/HorizontalTabs";

function MainContainer() {
  return (
    <div style={{ backgroundColor: "#F1F3FB" }}>
      <Button />
      <HorizontalTabs />
    </div>
  );
}

export default MainContainer;
